import React from 'react'
import Head from 'next/head'
import PaginationStyles from './styles/PaginationStyles'

const Pagination = ({page}) => {
    
    return (
        <PaginationStyles>
            <Head>
                <title>NargoreShop - Страница {page}</title>
            </Head>
        </PaginationStyles>
    )
}

export default Pagination
